# Example of pop() and pop(N)\nmy_list = [10, 20, 30, 40, 50]\n\n# Popping from the end (O(1))\nlast_element = my_list.pop()\nprint("Popped element:", last_element)  # Output: 50\nprint("Updated list:", my_list)        # Output: [10, 20, 30, 40]\n\n# Popping from a specific index (O(n-N))\nmiddle_element = my_list.pop(1)\nprint("Popped element:", middle_element)  # Output: 20\nprint("Updated list:", my_list)            # Output: [10, 30, 40]